import Button from './Button';
import React, { useState } from 'react';

const Counter = () => {
    const [count, setCount] = useState(0);
    return (
        <div>
            <div> { count } </div>

            <Button Onclick={() => setCount(count + 1)} color='' >
            </Button>

            <Button Onclick={() => setCount(count - 1)} color=''> 
            
            </Button>        
        </div>
    );
}

export default Counter;
